import './App.css';
import Formlogin from './components/Formlogin';
import { Route, Routes, BrowserRouter } from "react-router-dom";
import Diary from "./pages/Diary";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={
            <div className="main-content">
              <h1 className="title">Comienza a planificar tu día</h1>
              <Formlogin  
                message="Ingresa tus credenciales de acceso"
                email="Correo:"
                pass="Clave:"
                login="Ingresar"
                messageReg="¿No tienes cuenta? ¡Regístrate Ya!"
                register="Registrarse" 
              />
            </div>
          } />
          <Route path='/diary' element={<Diary />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
